(()=>{const e=document.createElement("progress");e.value=20,e.max=100,e.innerHTML="<span>running...</span>";const n=document.createElement("p");n.innerHTML="Lectura:";const a=document.createElement("h1");a.innerHTML="Curiosidades",a.setAttribute("align","center"),document.createElement("details"),document.createElement("details"),document.createElement("details"),document.createElement("details"),document.createElement("details");const o=document.createElement("summary");o.innerHTML="15 de julio";const t=document.createElement("summary");t.innerHTML="Tengo un perro";const d=document.createElement("summary");d.innerHTML="Familia";const r=document.createElement("summary");r.innerHTML="No me gusta McDonald's";const s=document.createElement("summary");s.innerHTML="Me gusta leer y bailar";const i=document.createElement("p");i.innerHTML="Nací un 15 de julio de 2003, fui la primera hija de mis papás, primogenita, si lo vemos así, también la primera nieta tanto del lado de mis papá como mamá, por lo que ya era esperada con ansias desde que anunciaron que venía a este mundo.<br><br>Fueron buenos años, era la consentida de ambas familias, mis tíos les gustaba llevarme de paseo a todos lados, también les gustaba comprarme vestidos o zapatos, eso fue hasta que mis tíos 2 años después empezaron a tener sus propios bebés al igual que mi mamá tuvo a mi hermano.<br><br><br>Algo curioso de esta fecha es que hay una película que se basa en el 15 de Julio, una de las mejores películas que he visto y me hace llorar cada vez que la veo, la película se llama One Day.<div style='text-align: center'><img src='15.PNG' width='650' height='350'></div>";const l=document.createElement("p");l.innerHTML="Tengo 3 perros de hecho, pero los demás son de mis hermanos, mi perro se llama Coockie es el ser más leal que he conocido, nació en la pandemia así que me a hecho compañía desde que nació, es Shi-Tzu y le gusta el tomate.<div style='text-align: center'><img src='cookie.jpeg' width='320' height='350'></div>";const m=document.createElement("p");m.innerHTML="Como mencioné antes, tengo 2 hermanos, uno de 18 y otro de 10 años, vivo con mis dos padres y mis 3 perros.<div style='text-align: center'><img src='familia.jpeg' width='250' height='350'></div>";const c=document.createElement("p");c.innerHTML="En serio, quién prefiere Mc Donald's en lugar de Burger King, los helados son deliciosos, no lo niego pero no comparto el gusto.";const u=document.createElement("p");u.innerHTML="Mi libro favorito es Cinder, es una novela de fantasía y romance de hecho cuenta con 4 libros los cuales aún no leo, pero tienen los mismos generos. He leído libros desde que tengo 12 años, recuerdo que los primeros libros que leí fuerón clásicos de la literatura, como Don Quijote de la mancha, Corazón, Marianela, entre otros, geniunamente a esa edad no entendía muy bien los sentimientos que el autor quería transmitirme, así que los volví a leer 3 años después, debo de mencionar que fue la mejor decisión de mi vida, cada vez que terminaba un libro, quería leer otro y otro";var p=document.createElement("div");p.style.textAlign="center";var h=document.createElement("a");h.href="historia.html";var g=document.createElement("img");g.style.textAlign="center",g.src="casa.png",g.width="50",g.height="50",h.appendChild(g),p.appendChild(h);var b=document.createElement("div");b.style.textAlign="right";var y=document.createElement("a");y.href="pags2.html";var v=document.createElement("h2"),C=document.createElement("b");C.textContent="Siguiente",v.appendChild(C),y.appendChild(v),b.appendChild(y),document.body.appendChild(a),document.body.appendChild(n),document.body.appendChild(e),document.body.appendChild(o),document.body.appendChild(i),document.body.appendChild(t),document.body.appendChild(l),document.body.appendChild(d),document.body.appendChild(m),document.body.appendChild(r),document.body.appendChild(c),document.body.appendChild(s),document.body.appendChild(u),document.body.appendChild(p),document.body.appendChild(b),document.body.style.backgroundImage="url(born.jpg)"})();